            { "vec", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" }, { PluralCategory.Many, "n != 0 && n % 1000000 == 0" } } },
            { "vo", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "vun", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "wa", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n >= 0 && n <= 1" } } },
            { "wae", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "xh", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "xog", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "yi", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 1" } } },
            { "zu", new Dictionary<PluralCategory, string> { { PluralCategory.One, "n == 0 || n == 1" } } },
        };

        internal static string? GetCondition(string locale, PluralCategory category)
        {
            if (_conditions.TryGetValue(locale, out var cats) && cats.TryGetValue(category, out var condition))
                return condition;
            return null;
        }

        internal static IEnumerable<PluralCategory> GetRequiredCategories(string locale)
        {
            if (_conditions.TryGetValue(locale, out var cats))
            {
                foreach (var cat in cats.Keys)
                    yield return cat;
            }
            yield return PluralCategory.Other;
        }

        internal static bool HasLocale(string locale)
        {
            return _conditions.ContainsKey(locale);
        }
    }
